"use client";

import { bot2 } from "@/axios";
import { useState } from "react";

const Page = () => {
  const [uploadImg, setUploadImg] = useState<string | null>(``);
  const [prompt, setPrompt] = useState("");

  const handleImageUpload = (e: any) => {
    const file = e.target.files[0];

    console.log(file)

    const reader = new FileReader();
    
    reader.onloadend = () => {
      const base64String = reader.result as string; // Ensure base64String is of type string
      console.log(base64String);
      setUploadImg(base64String);
    };
    reader.readAsDataURL(file);
  };

  const onsubmit = async (e: any) => {
    e.preventDefault();

    if (!uploadImg) {
      return console.log("no image");
    }
    const response = await bot2({ prompt: prompt, image: uploadImg });

    console.log(response.data);

  };
  
  return (
    <div>
      <form onSubmit={onsubmit}>
        <input type="file" accept="image/*" onChange={handleImageUpload} />
        <input
          type="text"
          value={prompt}
          onChange={(e) => setPrompt(e.target.value)}
        />
        <button>submit</button>
      </form>
    </div>
  );
};

export default Page;
